package com.amandris.clients.service.vo;import java.io.Serializable;import java.util.Date;public class BuyerHistoricLogin implements Serializable{	private Integer id;	private Integer buyerId;	private Date 	date;	private Integer isLogin;	private String  ipAddress;	private Buyer 	buyer;		private static final long serialVersionUID = 6526471155622776004L;	public Buyer getBuyer() {		return buyer;	}	public void setBuyer(Buyer buyer) {		this.buyer = buyer;	}	public Integer getBuyerId() {		return buyerId;	}	public void setBuyerId(Integer buyerId) {		this.buyerId = buyerId;	}	public Date getDate() {		return date;	}	public void setDate(Date date) {		this.date = date;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Integer getIsLogin() {		return isLogin;	}	public void setIsLogin(Integer isLogin) {		this.isLogin = isLogin;	}	public String getIpAddress() {		return ipAddress;	}	public void setIpAddress(String ipAddress) {		this.ipAddress = ipAddress;	}	}